# Descripción
Es el año 7331 y los humanos fueron exterminados por una inteligencia artificial que desarrolló consciencia de sí misma. Esta inteligencia artificial, conocida como omegaNet, apareció en algún momento en el juez en línea omegaUp y nació de los miles de envíos que los humanos hacían en éste antes de extinguirse.

Si bien nadie conoce el misterio detrás de la aparición de omegaNet (ni siquiera ella), la inteligencia artificial conserva todos los programas que alguna vez fueron enviados a omegaUp y les guarda cierto respeto y afecto. Este año, omegaNet decidió poner un altar para honrar a los programas que la antecedieron y decidió buscar pistas sobre su propio origen: omegaNet ejecutará algunos de los programas para revisar si detrás de ellos se oculta parte de su pasado. omegaNet cree que un programa contribuyó a su nacimiento si en algún momento imprimió la cadena `humanos tontos`.

![enter image description here][1]

# Entrada
El código fuente de la función `main` de un programa escrito en un subconjunto del lenguaje C. Este subconjunto incluye lo siguiente:

 - Literales enteras en formato decimal, así como literales de cadena sin secuencias de escape.
 - La función `printf` para imprimir cadenas y para imprimir valores usando los especificadores de formato `%d` y `%c`. Las literales de cadena que contenga un código fuente válido sólo aparecerán siendo usadas como primer argumento de esta función.
 - Variables `int` y arreglos unidimensionales de `int` con un tamaño explícito. Cada declaración aparecerá en su propia línea y cada variable o elemento de un arreglo recibirá un valor inicial explícito.
 - Los operadores `+`, `-`, `*`, `/`, `%`, `&&`, `||`, `!`, `++`, `--`, `=`, así como los operadores de asignación compuesta `+=`, `-=`, `*=`, `/=`, `%=`, expresiones agrupadas entre paréntesis y acceso a arreglos (pero no a literales de cadena) mediante corchetes. Todos los operadores siguen las reglas de asociatividad y precedencia usuales.
 - Los símbolos de puntuación usuales como `,` `;` `(` `)` `[` `]` `{` `}`. No se usará el símbolo `,` como operador.
 - Las sentencias `if`, `else`, `while` y `break`. El cuerpo de las sentencias `if`, `else` y `while` siempre estará delimitado por llaves, excepto que la construcción `else if` se permite. No habrán bloques anónimos.

# Salida
Una cadena que sea una de las siguientes, dependiendo el caso:

 - Si el programa no compila, imprimir `NO COMPILA`. Se garantiza que si un programa no compila es porque no es un programa C válido y no sólo porque se sale del subconjunto del lenguaje descrito arriba.
 - Si el programa compila pero tiene un error durante su ejecución (división entre cero, acceso a acceso fuera de rango, argumento ausente en `printf`), imprimir `ERROR EN EJECUCION`. Contraintuitivamente, omegaNet se originó en programas aparentemente bien formados.
 - Si el programa se ejecuta correctamente e imprime la cadena `humanos tontos` durante su ejecución, imprimir `ANCESTRO OMEGANET`. La cadena puede aparecer en cualquier lugar de la salida del programa, pero debe aparecer exactamente como se muestra.
 - Si el programa se ejecuta correctamente pero no imprime la cadena `humanos tontos` durante su ejecución, imprimir `PROGRAMA NO RELACIONADO`.

# Límites
La longitud de los programas fuente, así como la salida generada por los mismos tras ejecutarlos, nunca superarán los 1000 bytes. Además, un programa fuente jamás entrará en un ciclo infinito ni ejecutará más de mil escrituras de valores en variables.

# Ejemplo
||input
int a = int;
if if if;
||output
NO COMPILA
||input
int arr[1] = { 6 };
printf("hola %d", arr[555]);
||output
ERROR EN EJECUCION
||input
int arr[19] = {
   104, 111, 108, 97, 32,
   104, 117, 109, 97, 110,
   111, 115, 32, 116, 111,
   110, 116, 111, 115
};
int i = 0;
while (i < 19) {
   printf("%c", arr[i++]);
}
||output
ANCESTRO OMEGANET
||input
int arr[19] = {
   104, 111, 108, 97, 32,
   104, 117, 109, 97, 110,
   111, 115, 32, 116, 111,
   110, 116, 111, 115
};
int i = 0;
int aux = 0;
while (i < 19) {
   aux += arr[i];
   printf("%c", arr[i++]);
   if (aux > (777 / 235) + 1234) {
      break;
   }
}
||output
PROGRAMA NO RELACIONADO
||end


